import { resolve } from "path";
import fs from "fs";

// eslint-disable-next-line security/detect-non-literal-fs-filename
const rootDir = fs.realpathSync(process.cwd());
console.log(rootDir);
const resolveApp = (relativePath) => resolve(rootDir, relativePath);

const paths = {
  HTML_TEMPLATE: resolveApp("config/webpack/template.html"),
  BUILD_DIR_CLIENT: resolveApp("build/client"),
  BUILD_DIR_SERVER: resolveApp("build/server"),
  DOTENV: resolveApp(".env"),
  SRC_DIR: resolveApp("src"),
  SRC_DIR_CLIENT: resolveApp("src/client"),
  SRC_DIR_SERVER: resolveApp("src/server"),
  PUBLIC_DIR: "/static/",
};

paths.resolveModules = [
  paths.SRC_DIR_CLIENT,
  paths.SRC_DIR_SERVER,
  paths.SRC_DIR,
  "node_modules",
];

export default paths;
